import React from 'react';

const nome1 = 'Vinicius';
const nome2 = 'Jéssica';

const arrayNomes = [nome1,nome2]


class Blocks extends React.Component {
    render() {
        return (
            <div className='block-image'>
                {arrayNomes}
            </div>
        )
    }
}

export default Blocks;
